export default function DateTimeToString(date){
    let options = {
        year: 'numeric',
        month: '2-digit',
        day: '2-digit',
        hour: '2-digit',
        minute: '2-digit',
        second: '2-digit'
    }
    let newDate = new Date(date);
    let stringDate = newDate.getUTCFullYear() +"-"+ (newDate.getUTCMonth()+1) +"-"+ newDate.getUTCDate() + "T" + newDate.getUTCHours() + ":" + newDate.getMinutes();
    return stringDate == 'Invalid Date' ? '' : stringDate;
}
